from functools import reduce

jack = {"identity": "11111111110",
        "first_name": "jack",
        "last_name": "bauer",
        "salary": 100_000,
        "iban": "TR1",
        "birth_year": 1965,
        "email": "jack@example.com",
        "photo": "data:image/jpeg;base64,",
        "department": ["IT", "SALES"],
        "job_style": "FULL TIME"}
kate = {"identity": "2",
        "first_name": "kate",
        "last_name": "austen",
        "salary": 200_000,
        "iban": "TR2",
        "birth_year": 1985,
        "email": "kate@example.com",
        "photo": "data:image/webp;base64,",
        "department": ["IT"],
        "job_style": "PART TIME"}
employees = [jack, kate]
# imperative programming
total_salary = 0
for employee in employees:
    if "IT" in employee["department"]:
        total_salary += employee["salary"]
print(total_salary)
# declarative programming: functional programming
if_it_worker = lambda employee: "IT" in employee["department"]
to_salary = lambda employee: employee["salary"]
to_sum = lambda a, b: a + b
total_salary = reduce(to_sum, map(to_salary,
            filter(if_it_worker, employees)), 0)
print(total_salary)
